    [],nt"revision_timestamp": "2014-09-30T22:28:42.682373",nt"name": "san-francisco-bay-national-wildlife-refuge-complex-annual-narrative-report-1981",nt"isopen":
    false,nt"url": null,nt"notes": "The San Francisco Bay National Wildlife
    Refuge Complex comprises of three refuges including the San Francisco Bay National
    Wildlife Refuge, the San Pablo Bay National Wildlife Refuge, the Salinas Lagoon
    National Wildlife Refuge, Antioch Dunes National Wildlife Refuge and the Farallon
    Islands National Wildlife Refuge. The Annual Narrative Report is a discussion of
    the refuge condition over the course of the year. Wildlife, including migratory
    birds, raptors and other mammals as well as disease status are touched on. In addition,
    an overview of developments and maintenance that have taken place on the refuge
    is given. A summary of any research that has taken place is given as well as resource
    management strategies and public relations approaches. Management strategies, including
    fire management, pest control, habitat management, and wildlife management are also
    included in the annual narrative.",nt"license_title": "License Not Specified",nt"extras":
